    return(
        <>
        <div id="nav-admin" style={{display:'flex',justifyContent:"space-between",marginLeft:87}}>
            <img src = { require('../assets/Group 4.png').default }/> 
            <select style={{ borderRadius:50,width:50,height:50,marginTop:34,marginLeft:88}}>
                <option selected></option>
                <option> <img src={require('../assets/logout 1.png').default}/>Logout</option>
            </select>
        </div>
        </>
    )
}
